\u0412\u043e\u043f\u0440\u043e\u0441 13.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Термином "элефантерия" автор обозначил боевых слонов как род войск;
туловище слонов было покрыто броней, а ноги - уязвимы, поэтому им
полагалась специальная охрана.

\u0412\u043e\u043f\u0440\u043e\u0441 8.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
О территории КНДР, как можно заметить, информации немного;
демаркационная линия между КНДР и Южной Кореей проходит по 38-й
параллели, и граница, действительно, местами вполне прямая.

\u0412\u043e\u043f\u0440\u043e\u0441 14.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Отец Дездемоны не верит, что она смогла полюбить темнокожего Отелло;
Отелло начинает шмыгать носом, чтобы просьба подать ему носовой платок
выглядела более естественно.

\u0412\u043e\u043f\u0440\u043e\u0441 2.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
"Бинго" - игра, в которой игроки заполняют числа на своих карточках;
первый, заполнивший карточку, побеждает, он обычно выкрикивает "Бинго!";
словом "гринго" в Латинской Америке презрительно называют
неиспаноязычного иностранца, особенно американца.
